import s from './Experiences.module.css';
import store from '../../redux/store';


function Experiences(state) {
    impressions : [
        { impressions1: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Cumque atque corporis doloribus fugiat quis obcaecati ullam aliquam maiores recusandae et.' },
        { impressions2: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Cumque atque corporis doloribus fugiat quis obcaecati ullam aliquam maiores recusandae et heuhruehfueh.' },
        { impressions3: 'Lorem ipsum dolor sit amet consectetur  atque corporis doloribus fugiat quis obcaecati ullam aliquam maiores recusandae et.' }
    ]
    return (
        <div>

            <span id={s.header_experiences}>Experiences</span>

            <div className={s.experiences_cart}>
                <div className={s.title_div}>

                    <span id={s.company_name}>Facebook</span>
                    <br />
                    <img id={s.company_img} src="https://upload.wikimedia.org/wikipedia/commons/thumb/5/51/Facebook_f_logo_%282019%29.svg/1365px-Facebook_f_logo_%282019%29.svg.png" alt="facebook" />

                </div>

                <span id={s.software_engenieer}>Software engenieer</span>

                <span id={s.date}>400 տարի</span>

                <br />
                <span id={s.impressions}></span>
            </div>
        </div>
    );
}

export default Experiences;
